let loader = document.querySelector('#loader')
let firstButton = document.querySelector('#choose>p:first-child');
let secondButton = document.querySelector('#choose>p:nth-child(2)');
let blankDevice = document.querySelector('#blank_device_section');
let deviceSection = document.querySelector('#devices')

firstButton.onclick = () => {
    secondButton.classList.toggle('active')
    firstButton.classList.toggle('active')
    loader.style.display = 'block';
    
    setTimeout(() => {
        loader.style.display = 'none'
        blankDevice.style.display = 'none';
        deviceSection.style.display = 'block'
    }, 1000)

}


secondButton.onclick = () => {
    firstButton.classList.toggle('active');
    secondButton.classList.toggle('active');
    loader.style.display = 'block';

    setTimeout(() => {
        loader.style.display = 'none';
        deviceSection.style.display = 'none';
        blankDevice.style.display = 'block'
    }, 1000)
}


