const appendDeviceData = (data) => {

    let container = document.querySelector('#device-list')

    data.forEach(({ Image, deviceName, desc, info }) => {

        let div = document.createElement('div');
        div.setAttribute('class', 'device')

        div.innerHTML = `
        <div><img src="${Image}" alt=""></div>
        <div>
            <p>${deviceName}</p>
        </div>
        <div>
            <p>${desc}</p>
        </div>
        <div></div>
        `

        //! console.log('div : ', div.children[3].innerHTML)

        let childDiv = div.children[3];
        info.forEach(({ logo, span }, i) => {
            let anchorTag = document.createElement('a');
            if(i == (info.length - 1)){
                anchorTag.href = 'support.html';
            }else{
                anchorTag.href = 'https://apps.apple.com/app/lose-it/id297368629';
            }
            anchorTag.innerHTML = `
                <img src="${logo}"
                    alt="">
                <span>${span}</span>
            `
            childDiv.append(anchorTag)
        })

        container.append(div);
    })
}

