const activityAppendData = (data, sender) => {
    let container;

    if (sender == 'activity') {
        container = document.querySelector('#acitivity-device-list');
    } else if (sender = 'excercise') {
        container = document.querySelector('#excercise-device-list')
    }

    data.forEach(({ Image, Name }) => {
        let div = document.createElement('div');
        div.setAttribute('class', 'premium_device')
        div.innerHTML = `
        <div><img src="${Image}" alt=""></div>
        <div>
            <p>${Name}</p>
        </div>
        `
        container.append(div);
    })
}

activityAppendData(activityList, 'activity');

activityAppendData(excerciseList, 'excercise');